import React from "react";
import "../design/Home.css";
import { Row, Col, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import Logo from "../components/logo";

export default class Home extends React.Component {
  render() {
    return (
      <Container fluid>
        <Row>
          <Col
            md={4}
            sm={3}
            className="graySidebar"
            style={{
              display: "flex",
              justifyContent: "center",
              marginTop: "auto",
              marginBottom: "auto"
            }}
          >
            <Logo />
            <img src="https://image.flaticon.com/icons/svg/168/168882.svg"></img>
          </Col>
          <Col md={8} sm={9} className="whiteCarryover">
            {" "}
            This is white
          </Col>
        </Row>
      </Container>
    );
  }
}
